window.bookSummaryJSON = "<p>After a betrayal at work costs Song Kuan her job, she retreats to her friend Lucy’s idyllic family cabin on a lake in Minnesota to lick her wounds. She devotes herself to recording <i>Ice Cold Cases</i>, a true-crime podcast that she and Lucy cohost with the gleeful energy of obsessed fans—until an anonymous tip about a missing-person case disrupts their equilibrium. Then Lucy disappears, leaving Song alone in an unfriendly and unfamiliar town where locals don’t take kindly to strangers asking questions.</p> <p>Twisty, unpredictable, and sonically adventurous, <i>Song of the Northwoods</i> will keep you guessing until the final showdown.</p> <p><b>Portions of this audiobook contain mature language. Listener discretion is advised.</b></p> <p>Playwright Jessica Huang was awarded a commission through the Audible Emerging Playwrights Fund, an initiative dedicated to developing innovative original plays driven by language and voice. As an Audible-commissioned playwright, she received funding and creative support to develop <i>Song of the Northwoods</i>.</p> <p>Directed by Jaki Bradley.</p> <p>Now available in Dolby Atmos on Audible.</p>"; 
